description:
Looking for all concrete service that are marked with annotation Service. It fills a pool with any instances that can reuse in the application.

To use this library, you must perform following steps: 

1) Mark the current concrete service. 

example: 

public interface IServiceA{ 
   string GetName(); 
} 

[Service] 
public class ConcreteServiceA : IServiceA{ 
     public string GetName(){ 
           return "Antonio"; 
     } 
} 

N.B. Only one interface service must be marked with the "Service" annotation 

2) Start to search all concrete services 

InjectManager.Search() 

N.B. If you would create all instance of service, you will use this method InjectManager.Search(true) 
N.B. Use this method one time in your application! 

3) Inject your service in a property 

public class ServiceController{ 

     private IServiceA service = InjectManager.Inject<IServiceA>(); 

     ..... 

}

